using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.UI;

public class TestImgLoad : MonoBehaviour
{
    public Image nftImg;
    public TextAsset imageURL;
    string url = "";
    // Start is called before the first frame update
    void Start()
    {
        
    }

    public void OnClickImageLoad()
    {
        Texture2D _tex = GlobalData.instance.GetTextureFromBase64(url);
        Sprite sprite = Sprite.Create(_tex, new Rect(0.0f, 0.0f, _tex.width, _tex.height), new Vector2(0.5f, 0.5f), 100.0f);
        nftImg.sprite = sprite;
    }
}
